// This is the top-level Angular component in the app
import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  standalone: false,
  imports: [],
  template: `<h1>Hello world!</h1>`,
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  title = 'homes';
}
